import React from 'react'
import microscope from '../images/microscope.png'

function SavedDiseases({ bookmarks }) {
  return (
    <div className='bookmarks'>
        {bookmarks && bookmarks.map((bookmark) => (
            <div>
            <h2>{ bookmark }</h2>
            <img src={microscope} alt="delete icon" />
            </div>
        ))}
    </div>
  )
}

export default SavedDiseases
